import { useParams } from "react-router-dom";
import styled from "styled-components";
import { Link } from "react-router-dom";
const Title = styled.h1`
    color :${prpos=>prpos.theme.accentColor};
`
const Container = styled.div`

`
const Header = styled.header`
    display:flex;
    font-size:48px;
    height:10vh;
    align-items: center;
    justify-content:center;
`
const CoinList = styled.ul`
`
const Coin = styled.li`
    background-color:white;
    color: ${props=> props.theme.bgColor};
    margin-bottom: 20px;

    &:hover{
        color:${props=> props.theme.accentColor};

    }

`
const coins = [
    {
        id: "btc-bitcoin",
        name: "Bitcoin",
        symbol: "BTC",
        rank: 1,
        is_new: false,
        is_active: true,
        type: "coin",
        },
        {
        id: "eth-ethereum",
        name: "Ethereum",
        symbol: "ETH",
        rank: 2,
        is_new: false,
        is_active: true,
        type: "coin",
        },
        {
        id: "hex-hex",
        name: "HEX",
        symbol: "HEX",
        rank: 3,
        is_new: false,
        is_active: true,
        type: "token",
        },
]

const Coins = () =>{    
    return (
        <Container>
            <Header>
                <Title>코인</Title>
            </Header>
            <CoinList>
                {coins.map(coin=> <Link to={`/${coin.id}`}> <Coin key={coin.id}>{coin.name}</Coin> </Link> )}
            </CoinList>
        </Container>

    );
}
export default Coins;
